import React from "react";
import Head from "./header";
import "./body.css";
import Footer from "./footer";
import AOS from "aos";
import "aos/dist/aos.css";
import Services from "./ourservice";
import Portfolio from "./portfolio";

function Home() {
  AOS.init();
  return (
    <div>
      {/* data-aos="zoom-out" */}
      <Head />

      <div>
        <div className="banner fadeIn">
          <div>
            <hr style={{ marginTop: "0em" }} />
            <div className="blogus">BLOG</div>
            <div className="home-blogus">
              <span>HOME</span>
              <i
                className="fa fa-angle-right"
                style={{
                  marginLeft: "0.3em",
                  marginRight: "0.3em",
                  fontSize: "1.3em"
                }}
              ></i>
              <span>BLOG</span>
            </div>
          </div>
        </div>

        </div>

      <Footer />
    </div>
  );
}

export default Home;
